import React, {Component} from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Checkbox from '@material-ui/core/Checkbox';

const styles = {
    root: {
      flexGrow: 1,
    },
    grow: {
      flexGrow: 1,
    },
    menuButton: {
      marginLeft: -12,
      marginRight: 20,
    },
  };

class Sidebar extends Component {
  render() {
    const { classes } = this.props;
    return (
    <div className={classes.root}>
      <Drawer
        className={classes.drawer}
        variant="permanent"
        classes={{
            paper: classes.drawerPaper,
        }}
        >
        <div className={classes.toolbar} />
        <div className="sidebarHeader"> 
            Filters
        </div>
        <Divider />
        <div className="sidebarListHeader">
            Gender
        </div>
        <List>
        {['Men', 'Women', 'Boys', 'Girls'].map(value => (
            <ListItem key={value} className="sidebarList" role={undefined} dense button onClick={this.handleToggle(value)}>
                <Checkbox
                    checked={this.state.checked.indexOf(value) !== -1}
                    tabIndex={-1}
                    disableRipple
                />
                <ListItemText primary={`${value}`} />
            </ListItem>
        ))}
        </List>
        <Divider />
        <div className="sidebarListHeader">
            Categories
        </div>
        <List>
        {['Trousers', 'Skirts', 'Saree', 'Shirt'].map(value => (
            <ListItem key={value} className="sidebarList" role={undefined} dense button onClick={this.handleToggle(value)}>
                <Checkbox
                    checked={this.state.checked.indexOf(value) !== -1}
                    tabIndex={-1}
                    disableRipple
                />
                <ListItemText primary={`${value}`} />
            </ListItem>
        ))}
        </List>
        <Divider />
        <div className="sidebarListHeader">
            Brands
        </div>
        <List>
        {['Fab India', 'Zara', 'Vero Moda', 'Forever 21'].map(value => (
            <ListItem key={value} className="sidebarList" role={undefined} dense button onClick={this.handleToggle(value)}>
                <Checkbox
                    checked={this.state.checked.indexOf(value) !== -1}
                    tabIndex={-1}
                    disableRipple
                />
                <ListItemText primary={`${value}`} />
            </ListItem>
        ))}
        </List>
        </Drawer>
    </div>
    );
  }
}

Sidebar.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Sidebar);
